const College =(props) =>
{
    return(
        <>
          <div class="col">
           <div class="border">
             <h5 class="bg-info"> College name {props.cname} </h5>
               
               </div>   
          </div>
          <h1>college name {props.cname} </h1>
            <div>
                desc: { props.cdata}
            </div>
        </>
    )
}
export default College;
